import React from "react";
import balloon from "../images/hot-air-balloon-clip-art-balloon-c4b929081467b61f7a2c50f8056ab377.png";
import "./Balloon.css"; // make sure to import your CSS

const Balloon = () => {
  return( 
    <div className="balloons-container">
        <img src={balloon} alt="Balloon1" className="balloon" />
        <img src={balloon} alt="Balloon2" className="balloon" />
        <img src={balloon} alt="Balloon3" className="balloon" />
        <img src={balloon} alt="Balloon4" className="balloon" />
        <img src={balloon} alt="Balloon5" className="balloon" />
        <img src={balloon} alt="Balloon6" className="balloon" />
        <img src={balloon} alt="Balloon7" className="balloon" />
        <img src={balloon} alt="Balloon8" className="balloon" />
        <img src={balloon} alt="Balloon9" className="balloon" />
        <img src={balloon} alt="Balloon10" className="balloon" />
        <img src={balloon} alt="Balloon11" className="balloon" />
        <img src={balloon} alt="Balloon12" className="balloon" />
    </div>
);
};

export default Balloon;
